column4:
@moneillsf I have been tweeting about #JusticeForGeorgeFloyd as it truly is justice and we needed to see it. 

But I find your #BlackLivesMatter tweet difficult to read, where is your support for Noah? Not your occasional headline, your real support.

https://t.co/4eEPJSW0yP

@moneillsf Neither has the death of a young 14 year old called noah #NoahsArmy and the attempted murder of the young lad flynn 
But hey worrying about deaths across the pond 

FIGHT FOR OUR OWN BEFORE WE FIGHT FOR OTHER COUNTRIES

@moneillsf This guilty verdict should only be the beginning. I don’t want to see another hashtag for another murdered unarmed black person. Seeking justice for #GeorgeFloyd inspired my original song about overcoming hate.

Watch the full video at https://t.co/0UnHZhujvn

Please Retweet https://t.co/atc34YOKnr
